import React from 'react'
import { useNavigate } from 'react-router-dom';

function AdminPage({isLoggedIn}) {

  const navigate = useNavigate();
  console.log(isLoggedIn)

  if (!isLoggedIn){
    navigate("/login");
  }


  return (
    <div>
      <h2>HELLO</h2>
    </div>
  );
}

export default AdminPage;
